import React from 'react'
import ShoeItem from './ShoeItem';

export default function ShoesList(props) {
    const {products} = props ;
  return (
    <div className='row'>
        {products.map((product) => {
            return (
                <div key={product.id} className='col-sm-4'>
                    <ShoeItem product = {products}/>
                </div>
            )
        })}
    </div>
  )
}
